Nos missions sont celles qui ont été définies par le Ministère de la Culture en 1991 lors de la création du label Scène nationale, à savoir :
 – assurer la promotion et la diﬀusion de spectacles vivants ;
 – s’aﬃrmer comme un lieu de production artistique de référence nationale dans le domaine de la culture contemporaine ;
 – organiser la diﬀusion et la confrontation des formes artistiques en privilégiant la création contemporaine ;
 – participer aux niveaux local, départemental, régional, voire national à une action d’ouverture et de développement culturel favorisant de nouveaux comportements à l’égard de la création artistique et une meilleure insertion sociale de celle-ci. 

 Équinoxe – Scène nationale de Châteauroux appartient ainsi au réseau des 78 Scènes nationales françaises. 

 Elle déploie principalement son activité à Équinoxe – La Grande salle (1136 places), Équinoxe – Le Cinéma Apollo (328 places) et dans son studio Équinoxe – La Maisonnette de la culture (49 places) et Équinoxe - le Café ouvert une heure avant et une heure après chaque spectacle et, depuis septembre 2023, pour une dizaine de concerts de musique actuelle.

Imagine Microelectronics originates from the BW2030 initiative, a business platform reflecting on opportunities to foster innovation within the Walloon Brabant, and more globally the Walloon region. Imagine Microelectronics has been created to (1) accelerate the development of innovative and eco-responsible electronic system solutions, including original devices created by micro-nano-fabrication (sensors, etc.), (2) strengthen the strategic industries in Wallonia looking for local and high-quality microelectronics solutions, and finally (3) contribute to maintain and enrich local manufacturing capabilities. Imagine Microelectronics combines business and technical expertise and acts as a catalyst of microelectronic players (universities, excellence centres, market clusters, local investors, and large corporations). Its focus is to address business and technical needs related to TRL 3-7 with the following value proposition:
 - Universities (e.g. UCLouvain, ULiège, and UMons in Wallonia, etc.): acceleration of the maturation of laboratory technologies in TRL 3-4;
 - Start-up/ scale-up: access to new capabilities at lower cost in a nearby environment;
 - Large corporations: access to talent and expertise in the strategic areas of innovation;
 - Local investors: access to a high-quality deal flow and opportunities for investment.
